  (3355456, '2c9fafb062ca71c00162cdd45c8e0008', 'Abhik Banerjee\n\n 222 Senator Place, Apt #49\nCincinnati, OH 45220 \n513-364-6591\nbanerjee.abhik@yahoo.co.in\nhttp://homepages.uc.edu/~banerjak/ \n\n\n  \nEDUCATION\n\n University of Cincinnati                                                                                                                         \nMaster of Science in  Computer Science                \n      Cincinnati,OH\n    2009 - present\n\n  \nMaintained a GPA of 4.0/4.0 throughout. \nSpecializing in Data Mining, Algorithms for finding associations in gene Network using Semantic Web techniques.\nResearch Interests: Data Mining, Algorithms, Graph Mining, Information Retrieval, MapReduce/Hadoop.\n(Publication):- \"Measuring the Degree Of Similarity Between Web Ontologies\" (Abhik Banerjee, Hareendra Munimadugu, Srinivasa Vedanarayanan and Dr. Lawrence J Mazlack) Proceedings of the 14th WSEAS International Conference on Computers, Corfu, July 23-25, 2010\n\n\n \nUTKAL UNIVERSITY (Now BPUT)\nBachelor of Engineering, Computer Science\n  \nOrissa, India\n2002-2006\n\n\n  Independently taught Computer Science course, to a freshmen class on C and Data Structure.\nHighest Aggregate score in the department for the class of 2006 (Branch Topper).\nCompleted two Web Development projects in J2EE and Oracle (build an Online bidding System and the other for an Insurance Firm.)\n\n \nEXPERIENCE\n\n  Cincinnati Childrens Hospital Medical Center BMI R &D\nStudent Researcher\n  Cincinnati,OH\n2010-Present\n\n  Used various technologies like JSP, JAVA, AJAX, JPA, JavaScript, Prototypejs, Apache Tomcat, Firebug, ORACLE 11i for the maintenance and development of additional features for the following website -\nhttp://gataca.cchmc.org/gataca/ and http://toppgene.cchmc.org\n Found hidden associations between gene ontologies and disease records using Ontologies, and then applying graph mining/Data Mining algorithms to find new associations. (These algorithms can be widely applied to any data which has been collected from various other social communities like Facebook, Twitter etc.)\n Parsed huge XML files from NCBI database for further processing and finding the associations between various genes, diseases and Pubmed Ids using XML, XSLT, XPath, XML Databases,. \n\n \nMcAfee India Center\nSoftware QA Engineer\n\n \nBangalore, India\n2008-2009\n\n   Worked as a Software QA Engineer testing the various products on a release basis, their installation, customizations, unisntallation, reinstallation, product expiry etc. \n Optimized the overall time of testing by configuring an ESXI Vmware server and ran automated scripts for testing the product builds.\n  Automated the procedure of validating the Digital Signature files using C#.Net, for each product release which was earlier out of scope and was a source of a large number of bugs.\n\n \nHCL Technologies Ltd\nSenior Test Engineer/ Software Developer\n\n  \nBangalore, India\n2006-2008\n\n Worked as a Software Developer / Senior Test Engineer developing/testing the application devised for Deutche Bank (DB) dealing in FOREX market, money market and derivative market \nTrained fellow teammates on ORACLE, and JAVA basics and advanced topics.\nOptimized the SQL and PL/SQL queries for the Development and Production Environment which reduced the delivery time by 25%.\n\n  \n  \n\n  \n\n  \n  \n\n  \n\n  \n  \n\n  \n\n  \n\n  PROFESSIONAL SKILLS\n\n Languages / Technologies:              Java, C, C++, C#.Net, Matlab\n Application Servers :                        IIS Application Server, Apache Tomcat, Java Development Server\n Web and Databases:                         XHTML, ORACLE 11i,  MySQL, ORACLE SQL Developer\n Operating Systems:             Windows , MACINTOSH OS X, UNIX/LINUX , SOLARIS\n WEB Development:            JSP, ASP.Net, HTML, XML, XHTML, PHP, Perl, JavaScript , AJAX\n Other Technology:                           Hadoop MapReduce, HDFS, Amazon AWS.\n Other Softwares:           MS Office , Eclipse , Netbeans', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
  (3355457, '2c9fafb062ca71c00162cdd45c8e0008', 'Christof Meerwald\nKingston Road tel: +44 7757 188097\nLondon, SW19 e-mail: cmeerw@cmeerw.org\nUnited Kingdom web: http://cmeerw.org\n\nNationality: Austrian Languages: German, English\n\nProfile\n\nExperienced developer (and member of the ISO C++ Standards Committee) specialising in C++ development,\nbacked by a Masters degree in Computer Science. Versed in several programming languages (C/C++, Python and\nJava) on Unix and Win32 platforms with strong experience in language parsing and static code analysis.\n\nWork Experience\n\nSenior Software Developer Programming Research Ltd. since 3/2010\n Quickly became a key member of an elite C++ team by building on previous C++ compiler imple-\n\nmentation experience.\nkey technologies used: test-driven development\n\n Key developer responsible for extending the in-house C++ parser to support C++11 features: auto\ntype specifier, decltype, scoped and strongly typed enums, inline namespaces, explicitly defaulted\nand deleted functions, explicit conversion functions, rvalue references, variadic templates, noexcept,\nalias templates, user-defined literals, inheriting constructors, range-based for loops, lamda expressions\n(including init captures and generic lambdas), uniform initialization syntax, variable templates, nullptr\nand unicode character types. Ensuring quality of implementation by testing against the boost library\nand cross-checking test-cases with gcc, clang and Visual C++.\nkey technologies used: latest C++ standard working draft together with the C++ core working group\nissues list\n\n Static code analysis for C++: Implementing new static analysis checks, ongoing maintenance and\nbug-fixing.\n\n Contributed to the development of coding standards for AUTOSAR and RePhrase.\n\n Mentoring junior developers.\n\nSenior Software Engineer Emnico Technologies Ltd./Emnico Services Ltd. 1/2008  2/2010\n Network management application development  concentrating on SMI parser, SNMP/MIB and na-\n\ntive code integration for low-level network and OS access. Designed and implemented a versatile\nframework to access MIB data by auto-generating database data-access functions from MIB module\ndefinitions.\nkey technologies used: Java + JNI, XML + XSLT, SQL, Apache Derby, SNMP, MIB/SMI, low-level\nnetwork access\n\n Developed an asynchronous TCP/IP communication server.\nkey technologies used: C++, Boost\n\n Support and continuous development of an optical network management (SONET/SDH) system in a\nUnix environment (C++ on HP-UX and Linux).\nkey technologies used: C++, CMISE, OSI\n\n Linux embedded software development.\nkey technologies used: C/C++, SNMP, Linux, Python-based code generation\n\n\n\nSenior Software Engineer Alcatel-Lucent (formerly Lucent Technologies) 12/2005  12/2007\n Worked in a global development team on telecom network management software for optical net-\n\nworks (SONET/SDH) in a Unix environment (mostly C++ on HP-UX and Linux) with a Oracle based\ndatabase backend.\nkey technologies used: CMISE, OSI, SQL\n\n Low-level architectural work: porting of the low-level networking code from HP-UX to Linux; devel-\noped a debugging memory management library to facilitate detecting and tracking down of memory\nmanagement bugs.\nkey technologies used: low-level networking API on Linux (packet sockets), accessing a programs\ncall stack, reading ELF/SOM symbol table\n\nSoftware Engineer SBS Software Ges.m.b.H., Salzburg\nfull time: 11/2001  1/2003; 2/2004  11/2005\npart time: 10/1996  6/2000; 10/2000  10/2001; 4/2003  1/2004\nsummer internships: 7/1994  8/1994; 7/1995  8/1995; 7/1996  9/1996\n\n Developed several Java/JNI libraries to access Win32 specific APIs: i.a. CEN XFS, shared access to\nthe same RS-232 port by multiple processes.\nkey technologies used: Java + JNI, C++, script-based automated code generation, multi-threading,\nWin32\n\n Worked on a J2EE application for monitoring self-service banking terminals: SNMP integration,\ndatabase maintenance scripts.\nkey technologies used: Java + J2EE, WebSphere, SNMP, DB2 SQL\n\n Prototyped a custom firmware for the Linksys WRT54G to build a cost-efficient, custom security\nappliance (firewall and VPN).\nkey technologies used: Linux, gcc cross compiler, VPN\n\n Developed a replacement for the standard Windows shell (explorer) for self-service terminals that\ntakes care of starting and monitoring application processes and prevents unauthorized access to the\noperating system desktop.\nkey technologies used: C++ using STL and Boost libraries; Win32 API for starting and monitoring\nprocesses; COM Automation for inter-process communication and JNI for the Java integration\n\n Linux server and network administration: set up a centralised directory service, firewall and VPN\n(IPsec, OpenVPN) configuration.\nkey technologies used: Linux, LDAP, Samba\n\n Developed a highly scalable TCP/IP communication server for statement printers.\nkey technologies used: C++ using STL and Boost libraries; multithreaded design using Windows\nNTs I/O completion ports for high scalability\n\nCommunity Service Lebenshilfe Salzburg, Werksttte Hallein 2/2003  1/2004\n As an alternative to Austrias compulsory military service: working with people with mental or mul-\n\ntiple handicaps.\n\nSummer Internship AT&T Laboratories Cambridge 7/2000  9/2000\n Automated and improved the omniORB regression testing suite; developed a black-box CORBA\n\nserver testing tool in Python, based on annotations in the interface definition (IDL).\n\nLinux System Administrator HTBLA Salzburg part time: 9/1997  6/2000\n\n2\n\n\n\nEducation\n10/1996  10/2001: University of Salzburg, Department of Computer Science:\n\n5-year course in Applied Computer Sciences leading to a Masters degree (Dipl.-\nIng.)\nspecialised in distributed systems and wrote Masters thesis about distributed sim-\nulation: CORBA-based Conservative Distributed Discrete Event Simulation\n\n9/1991  6/1996: HTBLA Salzburg (secondary technical school for electronics/informatics):\nMatura (A-levels) with distinction\n\nIndependent Coursework\n\n Introduction to Databases - Coursera (Jennifer Widom, Stanford)\n Cryptography - Coursera (Dan Boneh, Stanford)\n Algorithms: Design and Analysis, Part 1 - Coursera (Tim Roughgarden, Stanford)\n Heterogeneous Parallel Programming - Coursera (Wen-mei W. Hwu, UIUC)\n Algorithms: Design and Analysis, Part 2 - Coursera (Tim Roughgarden, Stanford)\n Microeconomics Principles - Coursera (Jos Vzquez-Cognet, UIUC)\n Pattern-Oriented Software Architectures for Concurrent and Networked Software - Coursera (Douglas\n\nC. Schmidt, Vanderbilt)\n\nAdditional Skills\n ISO C++ Standards Committee Member\n\n Programming in C, C++ (including STL and some Boost libraries), Python and Java (incl. JNI) with\nthe ability to quickly understand an already existing, complex code-base.\n\n Development for Linux/POSIX platforms and Win32.\n\n Strong understanding of multithreaded development (i.e. concurrency, race-conditions, contention,\nthread-local storage)\n\n Contributor to StackOverflow for linux, sockets and multithreading tagged questions.\n\n Working on a socket abstraction library for C++ similar to Boost asio, but with better multithreading\nscalability.\n\n Developed and currently running JabRSS, an RSS (RDF Site Summary) headline notification service\nfor Jabber/XMPP.\n\n Significant contributions to LoquiIM, a multi-protocol instant messaging client written entirely in\nHTML5 and JavaScript. Implemented end-to-end encryption based on the Signal Protocol.\n\n Developed a HTML5-based map application for Firefox OS.\n\n Developed a lightweight SIP forwarding server (stateless SIP proxy) as well as a lightweight exim\ngreylisting server using a SQLite backend.\n\n Past contributor to the Open Watcom C++ compiler: major improvements to the C++ front-end (i.e.\npartial template specialization and partial ordering of class templates, template functions, namespace\nsupport and general C++ standard compliance).\n\n Contributed Linux-specific epoll connection handling code to the Open Source jabberd2 XMPP server\nto improve scalability for high number of concurrent connections.\n\n Open Source advocate familiar with many widely used Open Source licences (and with a good under-\nstanding of the implications of using Open Source software in a commercial environment).\n\n Organising and leading day trips for small groups.\n\nA hyperlinked version of this CV is also available at http://cv.cmeerw.org\n\n3', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
  (3355458, '2c9fafb062ca71c00162cdd45c8e0008', 'Kurt Guntheroth\n1426 East Roy Street\nSeattle, Washington 98112\n(206) 669-9474 / k  urt@guntheroth.com \n\nStaff Software Engineer\nA career technologist with 30+ years of commercial software design experience covering many \nfull product life-cycles. Special expertise in C++ development, network protocols, optimization, \nnew product concept formation, requirements analysis, software development methodologies. I \nam a scientist, a craftsman, and a mentor.\n\nKnowledge Keywords\nSoftware Development Experience: Windows, UNIX/Linux, embedded, database, cross-platform\nand multi-target development. Event-driven, real-time, parallel, multi-threaded, multi-processor. \nLanguages: C++ (20+ years). C (10+ years), Java, Javascript, Perl, Python, shell scrips. \nDatabases: Sybase & Microsoft SQL, SAS. Markup Languages: HTML5, XML, JSON. \nDevelopment Methodologies: Scrum, Agile, traditional, ISO-9000, Test Driven Development, \nCRC cards, UML. \nNetworking: sockets, WireShark dissectors, ZeroMQ library, RTP and forward error correction, \nTCP, UDP and multicasting, ICMP raw packets, SNMP, ASN1, H.323, IEEE 488.\nKnowledge Domains: Win32, MFC, TAPI, COM, ODBC, boost, video processing, telecom, \nsecurity, ssl programming, VoIP, functional test (2 U.S. patents), compilers, PLD programming, \nIEEE-1149 & 1352.\nTechnology Development Experience: industry standards committees, defect tracking systems, \nsoftware metrics. Trained in innovation management methods; affinity analysis, idea \ngeneration, facilitating, Pareto and Ishikawa analysis, Quality Function Deployment (QFD), \nTotal Quality Management (TQM).\n\nEducation and Training\nMaster of Business Administration, Seattle University, Seattle WA: Program partially \ncompleted. Topics included marketing, statistics, operations analysis\nMaster of Science in Computer Science, University of Washington, Seattle WA:\nThesis topic was an object-oriented, distributed programming language largely anticipating Java.\nSpecial topics included languages, distributed systems, artificial intelligence, networks.\nBachelor of Science in Computer Science, University of Washington, Seattle WA: \nTopics included compilers, operating systems, algorithms, and statistics. Minor in Mathematics.\nContinuing Education: Quality Function Deployment, Total Quality Management, Innovation \nManagement, Universal Modeling Language, Software Design Patterns, CASE and Design \nMethodologies, Advanced Windows, C++, Software Test Methodologies, System Engineering, \nCadence Management Seminar, Experience-based Interviewing, ISO 9000 Internal Auditor \ntraining, C++ Template Metaprogramming, Algorithm Design, Java, Android Development, \nVideo and Audio Processing.\n\nKurt Guntheroth (kurt@guntheroth.com) page 1\n\nmailto:GuntherothK@acm.org\n\n\nEmployment History\n\nDeveloper, 2014-2015, iStreamPlanet, Redmond WA\nDeveloped video pipeline code in C++/Win32. Implemented an MPEG-2 Transport Stream RTP \nsender and RTP receiver with Forward Error Correction based on redundant data per SMTPE \n2022-1. Developed GPU-accelerated video processing pipeline code using Intel Media Library.\n\nIndependent Consultant, 2009-2014 (5 years)\nThe Great Recession was hard on senior people who were standing up when the music stopped. \nI took a number of brief 1099 and W2 positions for several clients. Here are some highlights.\n\n? C++/Win32 development for Google\'s Chrome browser under contract to Microsoft. \nAdded experimental CSS styles to Chrome, developed JavaScript/HTML5 test cases, \nworked with Google\'s ninja build system designed for the very large Chromium code \nbase.\n\n? C++/Win32 development for Pokki; a program launcher, app store, and advertising \nnetwork for Windows that also provided a Javascript programming environment. \nImproved Pokki\'s visual appearance under non-default screen settings. Measured \nperformance and improved execution times by a factor of 4x. Worked with Windows \nAssessment Toolkit to ensure compliance with OEM Windows certification standards.\n\n? Designed, implemented, and documented a proprietary wire protocol for a networked \nLED lighting product on contract to Micron Technologies of Boise; coded a Wireshark \nsniffer plugin in C for the protocol, developed a lighting network controller in \nC++/Win32/SDK that encapsulated the proprietary protocol over an asynchronous RS232\nlink, and also included a full network and lighting device emulator. \n\n? Programmed complex core network and database server components in C++/Linux for a \ndistributed database with a novel spatial indexing scheme; mentored teammates in C++, \noptimized nave C++ code, improving data ingestion rate 60%, developed and \ndocumented error handling system.\n\n? Complex network and server programming in C++ on Windows and Linux for a radio-\nover-IP product; developed Wireshark dissector plugin in C for two proprietary network \nprotocols, documented the protocols, made point-fixes to undocumented legacy code. \nWorked with RTP protocol with NAK/Resend-based Forward Error Correction.\n\n? Wrote content for a wiki on multi-threaded development; created sample applications for \nIntel\'s Atom Developers Program; developed test fixture control software in \nC/VxWidgets.\n\nDuring down time, taught myself Java and Android programming, and developed an efficient \nfixed-point math template for C++.\n\nStaff Software Engineer, 2008-2009 (6 months), Attachmate Corp., Seattle WA\nDeveloped features for a cross-platform security product based on openSSH and openSSL in C \nand C++ on Windows plus 20 UNIX and Linux variants on a variety of hardware. Analyzed \nsecurity protocols for potential weakness and recommended fixes. Laid off with my whole team \nwhen company suffered an unexpected 30% revenue shortfall going into the Great Recession.\nKurt Guntheroth (kurt@guntheroth.com) page 2\n\n\n\nStaff Software Engineer, 1999-2008 (9 years), Aubeta Networks, Seattle WA\nDeveloped server components of a distributed business management system and Computer-\nTelephony-Integration (CTI) system in C++ on Windows. Took servers from prototype to \nhighly-available production code. Developed a network monitor for Aubetas customer WAN. \nBrought professional software development methods, defect tracking, documentation, and \nrelease management to AuBetas software team. \n\n? Integrated knowledge from several sources to produce a stack traceback on Windows \nstructured exceptions to facilitate rapid debugging of infrequently recurring bugs.\n\n? Improved mean time-to-failure of server suite from 2 hours to >1000 hours through \ndebugging, refactoring, and high-availability coding techniques.\n\n? Scaled server apps over 1-2 orders of magnitude growth in transaction rate. \n\nStaff Software Engineer, 1992-1999 (7 years), Data I/O Corp., Redmond WA\nChief architect and lead on a 30 man-year software project with 10 developers. Estimated \nmanpower, schedules, development costs, and project budgets. Hired staff, did performance \nreviews. Specified software development tools. Maintained team focus on objectives. Mentored \nteam members in C++, OO design methods. Developed Win32 and embedded C++ code for two \nprojects, and maintained C code for another. Did user needs analysis and design for four projects.\n\n? Represented Data I/O on IEEE 1532 (Boundary Scan Device Programming) and EIA/JEDEC\nJESD-71 (STAPL) industry standards committees. \n\n? Developed schedule using consensus work estimates de-rated for estimated availability. \nOriginal schedule estimated code complete within two per cent.\n\n? Performed R&D for next-generation products. Developed product concepts. Made first \ncontact with customers to establish user needs. Used rapid development techniques to meet \nharsh calendar schedule. \n\n? Helped establish software development process standards for successful ISO-9001 \ncertification. ISO 9000 internal auditor.   \n\nSenior Software Engineer, 1981-1992 (11 years) Fluke Corp., Everett WA\nProgressive responsibility as software designer and lead. Developed soft real-time code in C over\nmany full product life cycles. \n\n? Designed a programming language for functional test, an object oriented editor, and an \ninstrument control program similar to HP VEE or National Instruments LabWindows. \n\n? Member of a tiger team that developed a $20M (annual revenue) business opportunity. \nReceived special innovation management training for this project. Flukes successful LAN \ntester and indoor air quality meter products were outgrowths of this work. \n\n? Developed and patented innovative methods for testing semiconductor RAM and ROM \ndevices. RAM test is 3x faster than competing algorithms and has better coverage.\n\n? Represented Fluke on SCPI instrument control standard committee. SCPI officer 2 years. \n? Personally talked the U.S. Army out of a destructive change to MIL-T-28800 COTS \n\nprocurement standard. Built consensus among industry players to oppose this change.\n? Revised and automated a build system, reducing build time from 7 days of human attention \n\nto one day. Revised build system again a year later to reduce build time to require less than \none hour of human attention.\n\n? Led a team to perform causal analysis of over 600 bugs from a large development project. \n\nKurt Guntheroth (kurt@guntheroth.com) page 3\n\n\n\nPatents and Publications\nOptimized C++, O\'Reilly, Fall 2015\nhttp://www.guntheroth.com, personal web page, 2005-present \nKurt Guntheroth\'s Old Hands Blog, http://oldhandsblog.blogspot.com, 2011-present\nFixed-Point Types for C++, in C/C++ Users Journal, 5/2005\nCustom Exception Types for C++, in C/C++ Users Journal, 2/2005\nAttacking the Causes of Software Defects, in Fluke Technical Review, 10(2), Autumn 1992\nTester-Assisted Built In Test, in Proceedings of Autotestcon, 1989\nAn Inexpensive Robot Prober, in Proceedings of ATE&I East, 1988\nTL/1: A Language for Testing and Troubleshooting, in Proceedings of ATE&I West, 1988\nRapid Prototyping Languages Considered Harmful, Fluke Technical Review 7(1), Spring 1986\nMethod of and Apparatus for Diagnosing Faults in Read-Only Memory Systems and the Like, \nU.S. Patent 4,876,684, issued 10/24/1989\nMethod of and System for Fast Functional Testing of Random Access Memories, Jacobson et. al.,\nU.S. Patent 4,715,034, issued 12/22/1987\n\nKurt Guntheroth (kurt@guntheroth.com) page 4\n\nhttp://oldhandsblog.blogspot.com/\nhttp://www.guntheroth.com/', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
  (3355459, '2c9fafb062ca71c00162cdd45c8e0008', 'Curriculum Vitae\n\nPersonalia\n\nName Sander van der Burg\nHomepage http://www.st.ewi.tudelft.nl/sander\nDate of birth 24-05-1984\nNationality Dutch\n\nPlease contact me through my homepage for full contact details.\n\nProfile\n\nI am an enthusiastic and motivated person interested in software development, exploring, investigating and\napplying unconventional techniques, free and open-source software and collaborations between various software\ncommunities.\n\nWork Experience\n\n09-08 - present PhD candidate\nDelft University of Technology\nPhD candidate at the Software Engineering Research Group\n\n Working on a PhD dissertation titled: A Reference Architecture for Dis-\ntributed Software Deployment\n\n Publishing and presenting research at international software engineering con-\nferences\n\n Developing software tools related to software deployment and domain-specific\nlanguages: NixOS, Disnix, WebDSL\n\n Teaching assistant for the Concepts of programming languages lab course,\ncovering several programming language paradigms, such as Scala (functional\nprogramming), C (low-level) and JavaScript (prototype-based object orien-\ntation).\n\n06-09 - present Visiting researcher\nKoninklijke Philips Electronics N.V.\nVisiting researcher at Philips Healthcare\n\n Applying deployment research on medical software\n\n02-08 - 08-08 Intern Healthcare Systems Architecture\nKoninklijke Philips Electronics N.V.\nMSc thesis project at the Healthcare Systems Architecture department\n\n Development of Disnix  an automatic software deployment tool for service-\noriented systems.\n\n Applying deployment techniques on an experimental medical application.\n\nhttp://www.st.ewi.tudelft.nl/~sander\n\n\n05-02 - 02-08 IT specialist\nBosman Watermanagement B.V.\nApplication development and system administration\n\n Developing a web application framework based on PHP, Apache en MySQL\nand a number of applications.\n\n Developing a Java-based fat client application framework.\n Integration of applications with an ERP system.\n Supporting system administration tasks, such as workstation installations.\n Maintaining a number of servers, such as Linux, Novell Netware and Windows\n\n2000 machines.\n\n09-03 - 02-04 and Intern Hone/Link ADM\n02-05 - 06-05 IBM Nederland N.V.\n\nInternships at the Hone/Link ADM department\n\n Developing a system measuring the usage of Java EE applications in an IBM\nzSeries mainframe environment, which is used to tax costs to various internal\norganisation deparments.\n\nEducation\n\n2008-2012 PhD Software Engineering\nDelft University of Technology\n\n Dissertation title: A Reference Architecture for Distributed Software De-\nployment\n\n Followed courses: Scientific Writing in English, The Art of Presenting Sci-\nence, Philips Informatics Infrastructure Basic training\n\n Expected defense date: Januari 2013\n\n2005-2009 Master Computer Science\nDelft University of Technology\n\n Specialisation: Software Evolution, Model-driven Software Engineering\n Free elective courses: Computer graphics, Speech and language processing,\n\nMethodology and Ethics\n Thesis project at: Koninklijke Philips Electronics N.V., department of Health-\n\ncare Systems Architecture\n Obtained diploma in 2009\n\n2001-2005 HBO Computer Science\nRotterdam University of Applied Sciences\n\n Specialisation: Software Engineering\n Free elective courses: Linux assembly, Sailing license, Visual Basic, Astron-\n\nomy\n Thesis project at: IBM Nederland N.V. Hone/Link ADM department\n Obtained diploma in 2005\n\n1996-2001 HAVO\nRSG Hoeksche Waard\n\n Languages: Dutch, English, French 1 (speech and listening skills)\n Profile: Nature & Technology (Mathematics B 1+2, Physics 1+2, Chem-\n\nistry)\n Free elective courses: Economics 1, Computer Science\n Obtained diploma in 2001\n\n\n\nPublications (selection)\n\n Sander van der Burg, Eelco Dolstra, Disnix: A toolset for distributed deployment, In Science of\nComputer Programming (SCP), Elsevier, September 2012\n\n Sander van der Burg, Eelco Dolstra, A Self-Adaptive Deployment Framework for Service-Oriented\nSystems, In 6th International Symposium on Software Engineering for Adaptive and Self-Managing\nSystems (SEAMS). Waikiki, Honolulu, Hawaii, USA, ACM, May 2011\n\n Sander van der Burg, Eelco Dolstra, Automated Deployment of a Heterogeneous Service-Oriented\nSystem, In 36th EUROMICRO Conference on Software Engineering and Advanced Applications (SEAA).\nLille, France, IEEE Computer Society, September 2010\n\n Sander van der Burg, Eelco Dolstra, Merijn de Jonge, Eelco Visser, Software Deployment in a Dy-\nnamic Cloud: From Device to Service Orientation in a Hospital Environment, In First ICSE\n2009 Workshop on Software Engineering Challenges in Cloud Computing. Vancouver, British Columbia,\nCanada, IEEE Computer Society, May 2009\n\nSoftware (selection)\n\n Disnix (http://nixos.org/disnix). A tool which can be used to automatically deploy service-oriented\nsystems in networks of machines. Disnix uses Nix for local deployment and ensures that deployment\nprocesses are reliable, efficient and reproducible. Disnix is available as free and open-source software\nunder the LGPLv2 license.\n\n NixOS (http://nixos.org). Apart from developing Disnix, I contribute to other parts of the Nix project,\nsuch as NixOS  a Linux distribution which can be installed automatically from declarative specifications\nin a reliably, reproducible and efficient way.\n\n IFF libraries project (http://www.st.ewi.tudelft.nl/sander/index.php/software/iff). A project which\nconsists of libraries and tools capable of parsing and viewing file formats using the IFF container spec-\nification, such as images, animations and samples. All software packages are available as free and\nopen-source software, such as the MIT and zlib licenses.\n\n WebDSL (http://webdsl.org). A domain-specific language which can be used to specify properties of\nvarious aspects of web appli