anization within an account; selling entire portfolio of enterprise services; strategy to action\nby\nsuggesting right processes, skills, culture (people), technology and content; effectively\nmaintaining relationships with customers. Understanding key challenges of the customer;\nfinancial\nperformance of the client; competitors within the account; technology budget or spend; client\nspend on consulting. Key functions: business consulting; aligning IT to business; application\nportfolio review; business analysis/requirements; KPIs/scorecards; involved in writing;\nimplementing and tracking account plans; estimating budgets; business cases; RFPs; proposals\nand\nbusiness presentations.\n? Test Manager: Onsite / Offshore Operations: Involved in all key initiatives of the enterprise\nwith all vendors, pre sales activities, customer engagement, writing proposals, and Test\nconsulting.\n\n\n\nEstablished and managed practice improvement forum onsite with 50+ associates providing\ninputs\nto testing practice and provided lots of trainings.\n? Portfolio/Programme/Project Management level: Delivering programs and projects in managed\nportfolios from Initiation Business Case & Charter, through Requirements, Planning, Budgeting,\nExecution & Release Management, to closeout review while providing auditable progress &\ndeliverable completion visible to the project team, Management and stakeholders. IT projects\ncovering custom solutions, shrink-wrap product development, & commercial off-the-shelf\ndevelopment & integration.\n? Management and Governance establishing governance criteria and enforcing these through\neffective performance management & strategic planning; developing new opportunities;\npreparing\nbusiness cases, POC, POS and application review mechanisms; ensuring measurably high\ncustomer\nsatisfaction; setting BU objectives, educating, mentoring & guiding Sales & Marketing resources.\nDeveloping collaborative relationships with customers, vendors, and product support leaders.\nProviding integrated approach to CMMI, Earned Value, ROI, Training Plans, Satisfaction &\nExpectation Management, and Reporting.\n? Project Office, Project Procurement & Financial Management, developing, establishing &\nmaintaining PMO services, Organizational Governance tools & Systems, Traceability Matrix,\nproject & master Schedules, project Plans, Resource Profiles, organizational Capacity\nManagement, Cost, Risk & Issue, Integration sequence, Communication Plans, Mentoring,\nTraining, Templates, & Performance, for all PMBOK and CMMI disciplines.\n? Architecture, developing frameworks helpful for enterprises on strategic reuse, testing\nstrategy,\nautomation strategy, plans supporting Business Continuity essential to maintaining and\ncommunicating & solutions for business, development & stakeholder leaders & members.\n? Leadership, strong skills in Leadership, Motivation, Negotiation, Team building, Mentoring,\nTraining, Facilitation, Dispute Resolution, Collaboration, Communication & Organization\nDevelopment.\n? Process Engineering, Quality Assurance, Quality Control & Configuration Management,\nInvolved in SDLC definition and customization and method adaptation, process optimization,\nEnterprise-Wide Road Map for Standards Establishment, Components for Enterprise-Wide\nStandards, Standards Enforcement, Quality Assurance Continuum, Quality Control Continuum,\ndeveloping various test frameworks, methodologies and processes, Standard CMMI Appraisal\nmethod for Process Improvement (SCAMPI), establishing Quality Objectives, Goals, Metrics,\nForecasts, Enterprise level Test strategies, & tools, applying to IT Governance Frameworks.\n\nPersonal Strengths:\n? Provides direction and leadership with strong interpersonal and team building skills\n? Successfully works with people within and across organizational boundaries to build\nagreements,\nguidelines, and standards in order to resolve issues and create consistent practices.\n? Strong practitioner of 